import React from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Import Bootstrap CSS
import "./staff.css";

const Event2 = () => {
  return (
    <div className="row justify-content-center event1">
      <div className="text-center col-10">
      <div className="d-flex justify-content-evenly ">
        <div className="p-2">
          <h1>Access to hidden talent</h1>
          <p>We find IT specialists that fit your needs. Even for hard-to-fill positions.</p>
        </div>
        <div className="p-2">
          <h1>Selection by experts</h1>
          <p>All interviews are done by our team leads. Not algorithms or HR staff.</p>
        </div>
        <div className="p-2">
          <h1>Manage internally or outsource</h1>
          <p>Run the team in-house or fully outsource team management to us.</p>
        </div>
      </div>
    </div>
    </div>
  );
};

export default Event2;
